import ExpenseItem from "./Components/ExpenseItem";
function App() {
  const list = [{title: 'Car Insurance', amount: '245.65',date: new Date(2021, 2, 28)},
  {title: 'Car Insurance', amount: '245.65',date: new Date(2021, 2, 28)},
  {title: 'Car Insurance', amount: '245.65',date: new Date(2021, 2, 28)}];
  return (
    <div>
      <h2>Let's get started!</h2>
      {list.forEach((each)=>{
        <ExpenseItem title={each.title} amount={each.amount} date={each.amount}></ExpenseItem>
      })}
    </div>
  );
}

export default App;
